question.answer:
void wall_street_bet(double *prices, int length)
{
	int i, j;
	int max_buy = 0;
	int max_sell = 0;

	for (i = 0; i < length-1; i++) {
		for (j = i+1; j < length; j++) {
			if (prices[j] - prices[i] > prices[max_sell] - prices[max_buy]) {
				max_buy = i;
				max_sell = j;
			} else if (prices[j] - prices[i] == prices[max_sell] - prices[max_buy]) {
				if (j - i < max_sell - max_buy) {
					max_buy = i;
					max_sell = j;
				}
			}
		}
	}
	if (prices[max_sell] - prices[max_buy] <= 0) {
		printf("Hold\n");
	} else {
		printf("Buy @ %.2f on %d\n", prices[max_buy], max_buy);
		printf("Sell @ %.2f on %d\n", prices[max_sell], max_sell);
	}
}
